import { motion } from "framer-motion"



function App() {
  return (
    <motion.button 
    whileTap={{ scale: 0.8 }} 
    className="box font-semibold text-[#9900ff]"
    >
      <img src='./utdvector.png' />
    </motion.button>
  );
}


